        "vaeua-gui-eua.sas.van.control.initialValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor inicial (padrão) do controle. O valor inicial é selecionado na primeira vez que um usuário abre o relatório ou quando um usuário seleciona <span class\\="xis-windowItem">Restaurar estado padrão do relatório</span>. </p><div class\\="xis-paragraph">Insira um valor no campo de texto ou especifique um dos seguintes\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que sua seleção será salva como o valor inicial quando você salvar o relatório. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Primeiro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> especifica que o primeiro valor no controle é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que o valor do parâmetro selecionado é o valor inicial do controle.</p><p class\\="xis-paraSimple">Você pode selecionar um parâmetro somente se já existir um parâmetro com o tipo de dados apropriado.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Se o valor inicial não estiver na consulta de dados (por exemplo, devido a um filtro) e o controle não for necessário, o controle não terá valor inicial. Se o controle for necessário, o primeiro valor será selecionado como valor inicial.</p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Manipulação de sobreposição</span> especifica a ação realizada para exibir rótulos de barras quando não há espaço suficiente para exibi-los e eles ficam sobrepostos.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Automático</span></td><td>ajusta os rótulos automaticamente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Nenhum</span></td><td>não realiza a manipulação de sobreposição.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Reduza o número de categorias personalizadas para eliminar o seguinte problema. Por exemplo, para eliminar problemas de baixa prioridade, reduza o número de categorias personalizadas em seu relatório para 25 ou menos.</p><p class\\="xis-paragraph">Baixa prioridade\\: contém &gt; 25 categorias personalizadas</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Determina se o extrator de entidades usa a lista de entidades padrão.</p></section>',
