        "vaeua-gui-eua.Properties.partialdependence.numObs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número máximo de observações a serem amostradas a partir dos dados de entrada usados para gerar as previsões de modelo que são exibidas no gráfico Dependência parcial.</p></section>',
