        "vaeua-gui-eua.sas.van.Options.alternativeText.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica um nome significativo e acessível para um objeto. O texto é anunciado por um leitor de tela quando um usuário navega até o objeto.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Inclui conexões diretas entre cada neurônio de entrada e cada neurônio de destino na rede.</p></section>',
        "vaeua-gui-eua.properties.sankey.compress.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.factmac.learnStep.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Exibição de valor de visto</span> especifica o método usado para ajustar valores de marca de visto no eixo X. Você pode selecionar <span class\\="xis-windowItem">Reduzir sobreposição automaticamente</span> ou <span class\\="xis-windowItem">Orientação fixa</span>.</p><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Reduzir sobreposição automaticamente</span> é aplicada somente quando os valores de visto se sobrepõem. Você pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Escalonar, truncar, soltar</span></td><td>desloca os valores alternadamente para cima e para baixo, corta caracteres dos valores de visto e, em seguida, remove valores de visto.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Girar 45°</span></td><td>gira todos os valores de visto 45° na diagonal.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Irregular, truncar</span></td><td>desloca os valores de visto alternadamente para cima e para baixo e, em seguida, corta caracteres dos valores de visto.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Truncar</span></td><td>corta caracteres dos valores de visto.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Truncar, girar 45°</span></td><td>corta caracteres dos valores de visto e gira todos os valores de visto 45° na diagonal.</td></tr></table></div>                 </div><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Orientação fixa</span> é sempre aplicada e define a orientação dos valores. Você pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Horizontal</span></td><td>exibe valores de visto horizontalmente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Girar 45°</span></td><td>gira todos os valores de visto 45° na diagonal.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Girar 45°, soltar</span></td><td>gira todos os valores de visto 45° na diagonal e então descarta valores de visto.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Realiza uma seleção de variável de retrocesso rápido para determinar quais variáveis são levadas em consideração para a criação do modelo. Apenas variáveis com valores <span class\\="xis-userSuppliedValue">p</span>abaixo do nível de significância especificado são levadas em consideração.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Seu relatório demora muito para carregar a primeira página. Se o SAS Visual Analytics identificar problemas de desempenho diferentes de tempos de carregamento lento, corrija esses problemas primeiro. Se nenhum outro problema de desempenho for identificado, entre em contato com o administrador para determinar se outros fatores estão impactando seu relatório. Por exemplo, uma conexão lenta pode fazer com que um relatório seja carregado lentamente.</p><p class\\="xis-paragraph">Prioridade baixa\\: leva &gt;\\= 5 segundos</p><p class\\="xis-paragraph">Prioridade média\\: leva &gt;\\= 10 segundos</p><p class\\="xis-paragraph">Prioridade alta\\: leva &gt;\\= 25 segundos</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de ativação que é usada para criar a camada de saída ao usar uma distribuição normal para modelar a resposta. A função de ativação exponencial é usada com uma distribuição de Poisson ou gama. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Incluir itens de dados relacionados (atribuições de função, filtros e assim por diante) com o objeto salvo.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.heatmap.binCountNotApplicableToNonMeasures.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
