        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor alfa para a medida de complexidade de custo que é usada para aparar a árvore regressão. Um valor alfa maior resulta em uma árvore menor.</p></section>',
        "vaeua-gui-eua.usingTimeZones.help.tip.txt": "Qual fuso horário posso selecionar para várias datas?",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica se os links de texto para esta página estão ocultos para os usuários que não podem visualizá-la. </p><p class\\="xis-paragraph">Se você não habilitar essa opção, os usuários que não têm acesso verão uma mensagem de notificação quando tentarem seguir o link de texto.</p></section>',
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.tip.txt": "Mais informações sobre esta opção ",
