        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Determina se uma lista de exclusões é usada. Uma lista de exclusões é um conjunto simples de informações inferiores ou de palavras estranhas que você deseja remover do texto. As palavras devem ser salvas como um conjunto de dados SAS, que é carregado no servidor CAS.</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.tip.txt": "Mais informações sobre esta opção ",
