        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.region.placeholders.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa o número padrão de preditores a serem experimentados para cada divisão. O padrão é o número total de agentes de previsão. Caso contrário, especifique o número de preditores a serem tentados para cada divisão.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa o valor de penalidade padrão. O padrão é 1.0.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Se o número de observações que tiverem valores ausentes para um preditor candidato for maior que ou igual ao valor mínimo especificado, os valores ausentes serão tratados como um valor separado ao procurar candidatos a divisão.</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Espaçamento</span> especifica o espaço entre as barras.</p><p class\\="xis-paragraph">Para barras agrupadas que estão clusterizadas, o espaço aparece entre os clusters. Não há espaços entre as barras individuais em um cluster.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
