        "vaeua-gui-eua.sas.van.Options.CrosstabRestartNumbers.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Reduza o número de valores em ordenações personalizadas para eliminar o seguinte problema. Por exemplo, para eliminar problemas de baixa prioridade, reduza o número de valores selecionados em uma ordenação personalizada para 25 ou menos.</p><p class\\="xis-paragraph">Prioridade baixa\\: contém &gt; 25 classificações</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.logisticRegression.fConvValue.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.generalizedAdditive.fConvValue.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Estende a análise para incluir observações com valores ausentes. Para fatores de categoria, os valores ausentes são tratados como seu próprio nível quando a análise é realizada. Para fatores de medida, valores ausentes são usados no cálculo do valor de uma regra de divisão. É produzida uma regra de divisão que atribui os valores ausentes à ramificação que maximiza o valor da divisão.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.auto_stop_method.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica um critério para alavancar os dados de validação para finalizar o aprendizado em uma iteração localmente ideal.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.learningRate.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica um método para tratar valores ausentes para preditores. Para uma resposta de categoria, isso também trata os valores ausentes como um nível de resposta válido.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.Options.CrosstabRestartNumbers.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Controla como as células são ponderadas na matriz de termo por documento. O peso de célula é uma função que é aplicada a cada entrada na matriz de termo por documento para moderar o efeito de um termo que se repete em um documento.</p></section>',
        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf1d.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.ridge.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.models.usePartition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Particiona dados em um conjunto de dados de treinamento e um conjunto de dados de validação. Modelos que são construídos com dados de treinamento são verificados com os dados de validação para evitar excesso de ajuste.</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.nbins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de agrupamentos a serem usados para cada variável de medida ao gerar os gráficos polilineares de coordenadas paralelas. O binning detalhado pode resultar em desempenho de gráfico lento.</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa o número padrão de agrupamentos para calcular a estatística de elevação. O padrão é 20.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.tip.txt": "Mais informações sobre esta opção ",
