        "vaeua-gui-eua.sas.van.control.initialValue.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.ReportDistribution.ChooseMicrosoftTeamsChannel.Available.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.eventLevel.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor da resposta que representa o evento para calcular várias estatísticas, incluindo característica operacional do receptor e elevação.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de agrupamentos a serem usados para o cálculo das estatísticas de elevação. </p></section>',
        "vaeua-gui-eua.Properties.bayesNet.maxParents.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.vote.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica como as probabilidades previstas são calculadas para os níveis da resposta. </p></section>',
        "vaeua-gui-eua.ReportDistribution.ChooseMicrosoftTeamsChannel.Available.help.tip.txt": "Mais informações sobre esta opção ",
