        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor inicial (padrão) do controle. O valor inicial é selecionado na primeira vez que um usuário abre o relatório ou quando um usuário seleciona <span class\\="xis-windowItem">Restaurar estado padrão do relatório</span>. </p><div class\\="xis-paragraph">Insira um valor no campo de texto ou especifique um dos seguintes\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que sua seleção será salva como o valor inicial quando você salvar o relatório. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valor mínimo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> especifica que o menor valor no controle é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valor máximo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> especifica que o maior valor no controle é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que o valor do parâmetro selecionado é o valor inicial do controle.</p><p class\\="xis-paraSimple">Você pode selecionar um parâmetro somente se já existir um parâmetro com o tipo de dados apropriado.</p></dd></dl></div>                 </div></section>',
