        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Ordem de conexão</span> especifica como conectar os pontos de dados para formatar as linhas de plotagem. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Eixo</span></td><td>conecta os pontos de dados à medida que eles ocorrem da esquerda para a direita no eixo X.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Dados</span></td><td>conecta os pontos de dados na ordem em que eles são lidos a partir da função X.</td></tr></table></div>                 </div><p class\\="xis-paragraph">Você pode usar esse valor para garantir uma conexão ordenada quando os dados de entrada não estão classificados pela função X.</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número máximo de vetores de suporte. O número real de vetores de suporte pode ser ligeiramente maior que o número especificado devido à natureza do método do conjunto ativo.</p></section>',
