        "vaeua-gui-eua.Properties.neuralnetwork.maximumSeconds.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa o tempo máximo padrão para treinar a rede neural. O padrão é 270. </p></section>',
