        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Remova colunas não utilizadas na fonte de dados do relatório para eliminar o seguinte problema. Por exemplo, para eliminar problemas de baixa prioridade, certifique-se de que seu relatório use 10% ou mais das colunas na fonte de dados.</p><p class\\="xis-paragraph">Prioridade baixa\\: usa &lt;\\= 10% das colunas quando há 100 ou mais colunas em uma fonte de dados</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção de título automático pode não se aplicar a alguns objetos, como o valor da chave.</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o tamanho do passo de aprendizagem para o algoritmo SGD. Um aprendizado mais lento pode evitar o excesso de ajuste do modelo. O valor do passo de aprendizagem pode ser ajustado para garantir que o algoritmo de otimização converge de forma eficiente.</p></section>',
