        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tenta criar uma rede bayesiana de naïve aumentada em árvore, que inclui um link direto da variável de resposta para cada preditor, bem como uma estrutura de árvore entre os preditores. Redes bayesianas de naïve aumentadas em árvore exigem que o número máximo de pais seja sempre dois.</p></section>',
