        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tenta criar uma rede bayesiana primária-secundária, que estende a rede bayesiana de naïve. Esta extensão permite que os preditores sejam pais da variável de resposta, links entre pais e filhos da variável de resposta e links entre os filhos da variável de resposta.</p></section>',
