        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a profundidade dos agrupamentos percentis usados para calcular determinadas estatísticas. Essas estatísticas incluem média observada, elevação, elevação cumulativa, porcentagem cumulativa capturada e porcentagem cumulativa de eventos.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica se os links entre os nós são direcionados (unidirecionais) ou não direcionados (bidirecionais). O tipo de link afeta o cálculo de métricas de rede. Quando setas de link são exibidas, o tipo de link determina a direção das setas de link.</p></section>',
