        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Exibição de valor de visto</span> especifica o método usado para ajustar valores de marca de visto no eixo X. Você pode selecionar <span class\\="xis-windowItem">Reduzir sobreposição automaticamente</span> ou <span class\\="xis-windowItem">Orientação fixa</span>.</p><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Reduzir sobreposição automaticamente</span> é aplicada somente quando os valores de visto se sobrepõem. Você pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Soltar algum</span></td><td>solta alguns valores de visto.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Girar 45°</span></td><td>gira todos os valores de visto 45° na diagonal.</td></tr></table></div>                 </div><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Orientação fixa</span> é sempre aplicada e define a orientação dos valores. Você pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Horizontal</span></td><td>exibe valores de visto horizontalmente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Girar 45°</span></td><td>gira todos os valores de visto 45° na diagonal.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Girar 45°, soltar</span></td><td>gira todos os valores de visto 45° na diagonal e então descarta valores de visto.</td></tr></table></div>                 </div></section>',
