        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de clusters a serem criados ou especifica que o método do critério de caixa alinhada (ABC) deve ser usado para derivar um número ideal de clusters.</p><p class\\="xis-paragraph">O método ABC primeiro escolhe um número de clusters para criar, cria os clusters e calcula a estatística de lacuna para cada cluster. Em seguida, uma distribuição de referência que é orientada em torno de cada cluster é criada e a estatística de lacuna para cada distribuição de referência é calculada. Este processo é repetido para todo o número potencial de clusters. O número de clusters que maximiza a diferença total entre as estatísticas de lacuna dos clusters e os dados de referência é escolhido como o número ideal de clusters.</p><p class\\="xis-paragraph">O método ABC é válido apenas quando todas as entradas são variáveis de medição.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Mais informações sobre esta opção ",
