        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa o número padrão de preditores a serem experimentados para cada divisão. O padrão é a raiz quadrada do número total de preditores. Caso contrário, especifique o número de preditores a serem tentados para cada divisão.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de agrupamentos a serem usados para categorizar variáveis de medida no gráfico Dependência parcial.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ativa o algoritmo de colocação em cluster de médias k e ignora a ordenação de agrupamentos. Não selecione essa opção se quiser usar o algoritmo de pesquisa ávido e respeitar a ordenação de agrupamentos. Respostas de medida não agrupadas usam a variância como o critério de seleção. Quando essa opção está selecionada, respostas de categorias e respostas de medida agrupadas usam o critério de razão de ganho. Caso contrário, é usado ganho absoluto.</p></section>',
