        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tenta criar uma rede bayesiana de naïve e uma rede bayesiana de naïve aumentada em rede bayesiana. Uma rede bayesiana de naïve especifica que a variável de resposta é o único elemento primário de todos os preditores. Assume a independência condicional de todos os preditores, dada a variável de resposta. Uma rede bayesiana de naïve aumentada em rede bayesiana estende a rede de naïve, permitindo que os nós preditores formem uma rede bayesiana.</p></section>',
