        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número relativo de comunidades (agrupamentos de nós locais) a serem calculados. As comunidades são atualizadas dinamicamente quando a rede muda.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Força que fatores não negativos com termos de viés sejam definidos como zero. Isso pode melhorar o desempenho quando os dados de treinamento forem muito escassos.</p></section>',
