        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o nível de personalização que cada usuário pode fazer em sua visualização do relatório. Cada nível inclui os níveis abaixo dele.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Gera tags personalizadas em HTML para que o objeto ou relatório possa ser incorporado em uma página da web.</p><p class\\="xis-paragraph">Para habilitar tags personalizadas em sua página da Web, você também deve adicionar tags &lt;script&gt; ao cabeçalho da página. Para obter mais informações sobre como incorporar conteúdo do SAS Visual Analytics, consulte a <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">documentação do SDK do SAS Visual Analytics</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Espaçamento de cluster</span> controla a largura do espaçamento entre os clusters para barras agrupadas. Se você quiser alterar o espaço entre as barras, especifique a opção <span class\\="xis-windowItem">Espaçamento</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">O tipo de grupo de <span class\\="xis-windowItem">Valores distintos</span> está disponível somente para medidas que têm um número menor de valores exclusivos.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de agrupamentos de classe que são usados para categorizar uma resposta de medida.</p></section>',
