        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aumenta a árvore de decisão usando os dados de treinamento e limpa a árvore de decisão usando um algoritmo de complexidade de custo aplicado aos dados de validação.</p></section>',
