        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Cria as estruturas de rede especificadas, iterando sobre o número de pais de 1 para o valor do número máximo de pais. A rede com a melhor taxa de classificações erradas foi selecionada.</p></section>',
