        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o grau de sensibilidade usado para identificar valores extremos. Uma configuração de sensibilidade mais alta normalmente identifica mais valores como extremos.</p></section>',
