        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica que os usuários ignorem a tela de log-in e usem automaticamente as credenciais de convidado. Para usuários com credenciais de convidado, o estado de exibição não persiste entre as sessões, e preferências do usuário não estão disponíveis.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a profundidade máxima da árvore, em que o nó raiz é o nível 1.</p></section>',
