        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.learning_rate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a taxa de aprendizagem. Um aprendizado mais lento pode evitar o excesso de ajuste do modelo.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterTwo.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor máximo inicial (limite superior) do controle. O valor inicial é selecionado na primeira vez que um usuário abre o relatório ou quando um usuário seleciona <span class\\="xis-windowItem">Restaurar estado padrão do relatório</span>. </p><div class\\="xis-paragraph">Insira um valor no campo de texto ou especifique um dos seguintes\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que sua seleção será salva como o valor inicial quando você salvar o relatório. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valor máximo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que o maior valor no controle é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que o valor do parâmetro selecionado é o valor inicial do controle.</p><p class\\="xis-paraSimple">Você pode selecionar um parâmetro somente se já existir um parâmetro com o tipo de dados apropriado.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Especifica como o tráfego é usado para calcular o tempo de viagem para o recurso gráfico. Selecione uma das seguintes opções\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Não</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o cálculo do tempo de viagem usa uma média ponderada de dados de tráfego históricos para todas as horas do dia e para todos os dias da semana.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Tráfego atual</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o cálculo do tempo de viagem usa as condições de tráfego atuais. Esses dados de tráfego podem ser atualizados clicando <span data-icon-name\\="refresh" alt\\="no ícone Atualizar dados de tráfego" aria-label\\="no ícone Atualizar dados de tráfego"></span>. Quando um usuário visualiza o relatório, o tráfego não é atualizado automaticamente. O usuário deve atualizar os dados de tráfego para refletir as condições de tráfego mais recentes.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Tráfego típico</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> especifica que o cálculo do tempo de viagem usa tráfego típico para o horário e dia da semana especificados. As condições típicas de tráfego são baseadas em dados históricos recentes.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Observação\\:</span> A hora especificada é a hora local do local no mapa.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Observação\\:</span>A recuperação de dados de tempo de viagem consome créditos dos Serviços ESRI Premium.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Observação\\:</span>Se nenhum dado de tráfego estiver disponível para a área que contém o cálculo do tempo de viagem, os limites de velocidade publicados serão usados para calcular o tempo de viagem.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
