        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Efeitos compostos de cada par de itens selecionados. Este efeito requer pelo menos dois itens.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Selecione a variável a ser usada para dividir o nó. As variáveis são classificadas por valor no log, que mede quão bem essa variável divide os dados. Valor no log é o log negativo do valor p do teste chi-square.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Mostra a visão geral do eixo.</p><p class\\="xis-paragraph">Esta opção não estará disponível se mais de dois itens de dados forem atribuídos à plotagem.</p></section>',
