        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa a tolerância absoluta mínima padrão na qual uma iteração é interrompida. O padrão é 1.0E-6.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Remova os controles da área de pedido da página para eliminar o seguinte problema. Por exemplo, para eliminar problemas de prioridade média, reduza o número de controles na área de pedido da página para 10 ou menos.</p><p class\\="xis-paragraph">Prioridade média\\: contém &gt; 10 objetos na área de pedido da página.</p></section>',
