        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Controla como os termos são ponderados. O peso do termo é um número positivo atribuído a cada termo com base na distribuição desse termo na coleção de documentos. Essa ponderação pode ser interpretada como uma indicação da importância desse termo para a coleção de documentos.</p></section>',
