        "vaeua-gui-eua.Properties.predAuto.numFactors.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica se é necessário calcular grupos e exibir os três primeiros e os três últimos grupos nos resultados. Várias árvores de decisão são executadas na variável de resposta especificada, e cada grupo descreve uma folha em uma dessas árvores de decisão.</p></section>',
