        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o critério de convergência para o componente de gradiente máximo.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o erro de validação máximo aceitável para concluir o treinamento de modelo. Quando o erro de validação for menor que o valor de meta especificado, o treinamento de modelo será finalizado.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.standardization.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de distribuição que é usada para modelar a variável de resposta.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Rotação de estilos dos elementos de dados</span> especifica como estilos são atribuídos aos elementos de dados no modelo de gráfico. Em um gráfico de linhas, por exemplo, essa opção especifica como cores, padrões de linha e marcadores são usados para distinguir entre linhas no gráfico. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">usa a configuração de rotação de estilos do tema. A maioria dos temas SAS usa a configuração <span class\\="xis-windowItem">Girar todas as cores primeiro</span>. O tema Alto contraste usa a configuração <span class\\="xis-windowItem">Girar todos os atributos</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Girar todas as cores primeiro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">exibe um preenchimento sólido, uma linha sólida e uma forma de marcador consistente até que todas as cores na paleta sejam usadas.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Girar todos os atributos</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">exibe diferentes padrões de preenchimento, padrões de linha e formas de marcadores, além de cores diferentes. Essa configuração pode melhorar a acessibilidade para usuários com deficiência visual de cores (daltonismo).</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o parâmetro de escala (coeficiente) na função sigmóide.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de comunidades (agrupamentos de nós locais) para calcular dentro de cada cluster de nós. Observe que o número total de comunidades calculado pode ser menor do que o valor selecionado, dependendo da estrutura e do tamanho da rede.</p></section>',
