        "vaeua-gui-eua.glm.linkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de ligação que é utilizada para relacionar o modelo linear generalizado à distribuição da resposta.                 </p></section>',
        "vaeua-gui-eua.barLabelFitPolicy.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Os preditores categóricos tratam um valor ausente como um valor separado. Um preditor contínuo substitui um valor ausente pela média do preditor. Para redes bayesianas, os valores ausentes não são incluídos na variável de resposta.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Mais informações sobre esta opção ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Escala de agrupamento</span> determina como dimensionar gráficos de barras agrupados. As barras podem ser empilhadas ou clusterizadas. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valores reais</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">dimensiona as barras de acordo com os valores nos dados. Por exemplo, suponha que uma barra em um grupo tenha um valor de 50 e uma barra em outro grupo tenha um valor de 500. A barra de 500 seria 10 vezes mais alta que a barra de 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normalizar grupos para 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">apresenta os grupos usando uma escala relativa. Dentro de um grupo, cada barra é exibida como uma porcentagem do grupo. Por exemplo, suponha que um grupo tenha um valor total de 100. Se uma barra dentro desse grupo tiver um valor de 50, a barra será 50% da altura do grupo geral.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Essa opção não está disponível quando o objeto gráfico contém elementos gráficos sobrepostos. Essa opção também não está disponível quando você especifica o mesmo intervalo de dados para os eixos em uma treliça.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
        "vaeua-gui-eua.properties.sankey.linkColor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Colore os links entre os caminhos aos quais pertencem, os eventos a partir dos quais eles começam ou se eles são links suspensos.</p></section>',
        "vaeua-gui-eua.sas.van.Options.alternativeText.help.aria.txt": "Ajuda. Mais informações sobre esta opção ",
